import styled from 'styled-components';

export const Container = styled.ul`
    display: flex;
    flex-direction: row;
    /* justify-content: 'space-around'; */
    align-items: center;
    background: rgb(73, 79, 82);
    color: white;
`;

export const NavLink = styled.li`
    list-style: none;
    padding: 10px 10px 10px 10px;
    margin: 10px;
`;
